/**
 * @param {string} s
 * @return {string}
 */
var maximumOddBinaryNumber = function(s) {
    // Count the number of '1's and '0's in the string
    let ones = 0, zeros = 0;
    for (let char of s) {
        if (char === '1') ones++;
        else zeros++;
    }

    // The strategy is to put all '1's at the beginning followed by '0's,
    // ensuring the last digit is '1' to make the number odd.
    // Since we need at least one '1' at the end, we place the rest of the '1's before the '0's.
    let result = '';
    // Add all '1's except one
    for (let i = 0; i < ones - 1; i++) {
        result += '1';
    }
    // Add all '0's
    for (let i = 0; i < zeros; i++) {
        result += '0';
    }
    // Add the last '1' to make the number odd
    result += '1';

    return result;
};
